import React from "react";
import FlipCard from 'react-flipcard';


const Hobby = ()=>{
    return(
        <div>
        <FlipCard>
            {/* The first child is used as the front of the card */}
            <div>
            <div>Front</div>
            <div>(horizontal flip)</div>
            </div>
            {/* The second child is used as the back of the card */}
          <div>Back</div>
        </FlipCard>
        </div>
    )
}


export {Hobby};
